import React, { useState } from 'react';
import CsvUploader from './components/CsvUploader';
import Header_Interpret from './components/Header_Interpret';
import logo from './logo.svg';
import './App.css';

function App() {
  const [csvHeaders, setCsvHeaders] = useState([]);
  const [showInterpretations, setShowInterpretations] = useState(false); // New state variable

  return (
    <div className="app-container">
      <header className="app-header">
        <img src={logo} className="app-logo" alt="logo" />
        <h1>CSV and OpenAI Integration</h1>
      </header>
      <div className="app-content">
        <CsvUploader setCsvHeaders={setCsvHeaders} />
        <button onClick={() => setShowInterpretations(true)}>Interpret Headers</button> {/* New Button */}
        {showInterpretations && <Header_Interpret csvHeaders={csvHeaders} />} {/* Conditionally render */}
      </div>
    </div>
  );
}

export default App;
